import hand from '../../../assets/rock.png';

import './Hands.css';

const Hands = () => {
  return (
    <div className="hands">
      <img className="player-hand" src={hand} />
      <img className="computer-hand" src={hand} />
    </div>
  );
};

export default Hands;
